import React from "react";


class TemperatureSlider extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <input className="tempSlider" type="slider" min="1" max="6000" value="0" />
            </div>
        );        
    }
}

export default TemperatureSlider
